    //       <option value="2">{broodjeMenu.boter}</option>
    //       <option value="3">{broodjeMenu.beleg}</option>
    //     </div>
    //   );
    // });

    return (
      <div className="container">
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Broodsoort
            </option>
            <div className="broodjeMenu">
              <option value="1">{broodjeMenu.broodSoort}</option>
              <option value="2">{broodjeMenu.boter}</option>
              <option value="3">{broodjeMenu.beleg}</option>
            </div>
          </select>
        </div>
      </div>
    );
  }
}

export default BroodjeMenu;
